      <div>
        <TopNavBar
          onClickPortrait={() => this.setState({photos: Portraits})}
          onClickColombia={() => this.setState({photos: Colombia})}
          onClickGrad={() => this.setState({photos: Grad})}
          onClickBack={() => this.props.onClickBack()}
        />
        <Gallery photos={this.state.photos} />
      </div>
		)
	}
}

